import './App.css';
import HeaderTest from './HeaderTest';
function App() {
  const headerStyle = {
    backgroundColor: "red",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    height: "50px",
    color: "white",
    padding: "10px",
  }
  const cikisStyle = {
    cursor: 'pointer'
  }
  var degisken="Karaktersiz Erdem"
  var UserName="Erdem"
  return (
    <div className="App">
      <div style={headerStyle}>
        <div></div>
        <div>Hoşgeldin: {UserName}</div>
        <div style={cikisStyle}>Çıkış</div>
      </div>
      <header className="App-header">
        <p>{degisken}</p>
        <p>HeaderTest burada olacak.</p>
        <HeaderTest/>
      </header>
    </div>
  );
}

export default App;
